import React, { Component } from 'react';
// import logo from './logo.svg';
import './App.css';
import NavBar from "./pages/NavBar";
import SocialBar from "./pages/SocialBar";
import VideoSection from "./pages/VideoSection";
import TitleSection from "./pages/TitleSection ";
import CommentSection from "./pages/CommentSection";
import VideoList from "./pages/VideoList";

class App extends Component {
  state = { 
    videolist: [
    {id: "1234",
     name: "TEX @ TOR Gm5: Blue Jays take lead in wild 7th inning",
     username: "MLB",
     views: "1.1M views",
     likes: 234,
     dislikes: 435,
     subscribes: 2300,
     src: "./Assets/Images/hqdefault.jpg",
     comments: {
      username: "Landon",
      reply: " This is cool! "
     }

    }
  ]
};
  render() {
    return (
      <div className="App">
            <NavBar/>
            <SocialBar/>
            <main>
              <section className="mainbar">
               <VideoSection/>
               <TitleSection commentsArray={this.state.videolist}></TitleSection>
               <CommentSection videosArray={this.state.videolist}></CommentSection>
              </section>
              <VideoList videosArray={this.state.videolist} ></VideoList>
            </main>      
      </div>
    );
  }
}
export default App;
